import { QuestionNavbar } from "../QuestionNavbar.js";
import { Info } from "./components/Info.js";

export const Info16 = () => {
  return (
    <div className="infos">
      <QuestionNavbar />
      <Info
        title={[
          "Kun informaatiota ja sisältöjä on nykyisin lähes äärettömästi, kilpailua käydään yleisön huomiosta. Miten yleisö valitsee sisällöt, perustuu heidän tarpeisiinsa, asenteisiin ja tunnetilaan. Huomiotalouden tyyppisessä kilpailussa eettiset kysymykset ovat vaarassa jäädä paitsioon.​​​",
          "Miten tärkeää huomion saaminen on sinulle? Onko jutun tarkoituksena herättää huomiota jonkin tavoitteen saavuttamiseksi? Voiko huomion herättämättömyys (esim. moralisoimattomuus) olla myös eettinen valinta?​​​​​",
        ]}
        options={[
          {
            value: "Väliverronen (2019): Huomiotalouden orjat​​",
            navigate: "https://medykblog.wordpress.com/2019/10/18/huomiotalouden-orjat/",
          },
          {
            value: "Reuters-raportti 2023 tarjoaa ajantasaista tietoa yleisön asenteista uutismedioita kohtaan: Uutismedia verkossa 2023. Reuters-instituutin Digital News Report",
            navigate: "https://trepo.tuni.fi/handle/10024/149682",
          },
        ]}
        next={"study/19"}
      />
    </div>
  );
};
